            <Card.Header>
              <Accordion.Toggle as={Button} variant="link" eventKey="1">
                <img alt="java" style={{borderRadius:"5%"}} src={Python} height="100%" width="100%" />
              </Accordion.Toggle>
            </Card.Header>
            <Accordion.Collapse eventKey="1">
              <Card.Body>Java</Card.Body>
            </Accordion.Collapse>
          </Card>

        </Accordion>
      )
    }
}
export default Languages;
